import axios from "axios";
import {
  fetchTicketLoading,
  fetchTicketSuccess,
  fetchTicketFail,
} from "./ticketSlice";

export const fetchAllTickets = () => async (dispatch) => {
  dispatch(fetchTicketLoading());

  try {
    const result = await axios.get("http://localhost:3001/v1/ticket", {
      headers: {
        Authorization:
          "&eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6Im9rb3BAcC5jb20iLCJpYXQiOjE2MjUwNTMyMjEsImV4cCI6MTYyNTA1NDEyMX0.lNttzznyjNmhQfQkw7PtxVTtk3oYjxaJa68uRto8Sw0",
      },
    });
    dispatch(fetchTicketSuccess(result.data.result));
    if (!result.data.result) {
      dispatch(fetchTicketFail(error.message));
    }
    console.log(result);
  } catch (error) {
    dispatch(fetchTicketFail(error.message));
  }
};
